import React, { useEffect } from "react";
import { connect } from "react-redux";

import { fetchDoor } from "../../actions";
import EditForm from "../common/EditForm";

const DoorsEdit = ({ fetchDoor, match }) => {
  const { id } = match.params.id;

  useEffect(() => {
    fetchDoor(id);
  }, [fetchDoor, id]);
  return (
    <React.Fragment>
      <h2>DoorsEdit</h2>
    </React.Fragment>
  );
};

export default connect(null, { fetchDoor })(DoorsEdit);
